import Navigation from "./components/Navigation";
import Header from "./components/Header";
import Main from "./components/Main";
import Footer from "./components/Footer";
import Popup from "./components/Popup";
import "./App.css";

function App() {
  return (
    <>
      <Navigation />
      <Header />
      <Main />
      <Footer />
      <Popup />
    </>
  );
}

export default App;
